	/**
	 * 診療時間マスタ
	 * @param type $hospitalId
	 */
	private function registTimetable($hospitalId)
	{
		$row = Model_Db_Mhospitaltimetable::forge();
		$row->m_hospital_timetable_hospital_id = $hospitalId;
		
		
		$days = array("mon", "tue", "wed", "thu", "fri", "sat", "sun", "hol");
		foreach ($days as $d)
		{
			if (rand(0, 1))
			{
				$col = "m_hospital_timetable_" . $d;
				$row->$col = true;
				$b = rand(0, 1);
				if ($b)
				{
					$col2 = $col . "_time_1_from";
					$row->$col2 = "10:00";
					$col2 = $col . "_time_1_to";
					$row->$col2 = "12:00";
				}

				$col2 = $col . "_time_2_from";
				$row->$col2 = "13:00";
				$col2 = $col . "_time_2_to";
				$row->$col2 = "17:00";

				if (!$b)
				{
					$col2 = $col . "_time_3_from";
					$row->$col2 = "19:00";
					$col2 = $col . "_time_3_to";
					$row->$col2 = "21:00";
				}
			}
		}

		$row->m_hospital_timetable_earlymorning = (rand(0,1) == 0);
		$row->m_hospital_timetable_morning = (rand(0,1) == 0);
		$row->m_hospital_timetable_afternoon = (rand(0,1) == 0);
		$row->m_hospital_timetable_evening = (rand(0,1) == 0);
		$row->m_hospital_timetable_night = (rand(0,1) == 0);
		
		$row->m_hospital_timetable_memo = null;
		$row->m_hospital_timetable_created_at = System::now();
		$row->m_hospital_timetable_updated_at = null;
		$row->m_hospital_timetable_deleted_at = null;

		$row->save();
	}

	/**
	 * 病院アクセスマスタ
	 * @param type $hospitalId
	 */
	private function registAccess($hospitalId)
	{

		$meansList = array("1", "2", "3", "4");

		$exit = array("A", "B", "C", "D", "E");


		$sql = "select m_station_group_code,m_station_name from m_station group by m_station_group_code,m_station_name order by random() limit " . rand(1, 4);
		$query = DB::query($sql);
		$stationList = $query->execute()->as_array();

		if (rand(1, 10) == 1)
		{
			$stationList[] = array("m_station_group_code" => "1130208");
		}

		foreach ($stationList as $station)
		{
			$row = Model_Db_Mhospitalaccess::forge();
			$row->m_hospital_access_hospital_id = $hospitalId;
			if (rand(1, 10) == 2)
			{
				$row->m_hospital_access_memo = "○○バス○○停留所より徒歩9分";
			}
			else
			{
				$row->m_hospital_access_station_gcode = $station["m_station_group_code"];
				$row->m_hospital_access_station_code = $station["m_station_group_code"];
				$row->m_hospital_access_exit = (rand(0, 1) == 1) ? null : $exit[rand(0, 4)] . rand(1, 5);
				$row->m_hospital_access_time_from_station = rand(1, 20);
				$row->m_hospital_access_means_code = $meansList[rand(0, 2)];
				$row->m_hospital_access_memo = null;
			}

			$row->m_hospital_access_display_order = 999;
			$row->m_hospital_access_created_at = System::now();

			$row->save();
		}
	}

	/**
	 * 診療科目登録
	 * @param type $hospitalId
	 */
	private function registCourse($hospitalId)
	{
		$courseList = Model_Db_Mcourse::find_by("m_course_category_id", rand(1, 9));
		$max = rand(1, 3);
		$i = 0;
		$forte = array();
		foreach ($courseList as $course)
		{
			if ($max == $i)
			{
				break;
			}
			//Log::info($hospitalId . "：".$course->m_course_id);
			$row = Model_Db_Thospitalcourserelation::forge();
			$row->t_hospital_course_relation_hospital_id = $hospitalId;
			$row->t_hospital_course_relation_course_id = $course->m_course_id;
			$row->save();

			$forte[] = $course->m_course_name;
			$i++;
		}
	}

	/**
	 * 口コミ
	 * @param type $hospitalId
	 */
	private function registReview($hospitalId)
	{
		$max = rand(0, 3);
		for ($j = 0; $j < $max; $j++)
		{
			// ニックネーム生成
			$chars = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJLKMNOPQRSTUVWXYZ0123456789";
			$nickname = "";
			for ($i = 0; $i < 6; ++$i)
			{
				$nickname .= $chars[mt_rand(0, 61)];
			}

			$row = Model_Db_Thospitalreview::forge();
			//$row->t_hospital_review_id = "";
			$row->t_hospital_review_nickname = $nickname;
			$row->t_hospital_review_hospital_id = $hospitalId;
			$row->t_hospital_review_message = $this->dummyReview[rand(0, 11)];
			$row->t_hospital_review_status = ReviewStatus::PUBLISH;
			$row->t_hospital_review_created_at = System::now();
			$row->t_hospital_review_updated_at = null;
			$row->t_hospital_review_deleted_at = null;
			$row->save();
		}
	}

